jQuery(function($){let bookingEntry=$(".detail-booking-entrypoint");if(bookingEntry.length>0){let bookingEntryTransportType=$('.booking-filter-radio--transport-type input[type="radio"]');let bookingEntryAirportField=$(".booking-filter-item--airport");bookingEntryTransportType.on("change",function(e){var thisType=$(this).val();if(thisType=="FLUG"){bookingEntryAirportField.removeClass("d-none")}else{bookingEntryAirportField.addClass("d-none")}});let bookingEntryCalendar=$(".booking-filter-field--date-range");var getTransportType,getAirport,getDur=null;bookingEntryCalendar.on("click touch",function(e){e.preventDefault();getTransportType,getAirport,getDur=null;getTransportType=$('.booking-filter-radio--transport-type input[type="radio"]:checked').val();getDur=$(".booking-filter-field--duration").val();if(getTransportType==="FLUG"){getAirport=bookingEntryAirportField.find('input[type="radio"]:checked').val()}renderBookingCalendar(getTransportType,getAirport,getDur);e.stopPropagation()});function renderBookingCalendar(transportType,airport,duration){console.log("Render calendar with values:");console.log(transportType);console.log(airport);console.log(duration)}}});